package AdventOfCodeKotlin.puzzles.EverybodyCodesStory02

import AdventOfCodeKotlin.util.Graph.Companion.buildGraph
import AdventOfCodeKotlin.util.ModularArithmetic
import AdventOfCodeKotlin.util.Node

fun main(args: Array<String>) {
    Quest03.part1()
    Quest03.part2()
    Quest03.part3()
}

class Quest03 {

    companion object {

        class Die(val id: Int, private val faces: List<Int>, val seed: Int) {

            var rollCounter = 0
            var pulse = seed.toLong()
            var faceIndex = 0
            fun roll(): Int {
                rollCounter++

                val spin = rollCounter * pulse
                faceIndex = (faceIndex + spin).mod(faces.size)
                pulse += spin
                pulse = pulse.mod(seed.toLong())
                pulse += 1 + rollCounter + seed
                return faces[faceIndex]
            }

            fun currentFace(): Int {
                return faces[faceIndex]
            }
        }
        fun part1() {
            val input = """
                1: faces=[1,2,3,4,5,6] seed=338999
                2: faces=[-1,3,5] seed=339071
                3: faces=[0,1,-1,2,-2] seed=340037
                4: faces=[-1,2,3,4,5,6] seed=339323
                5: faces=[5,7,7,5,10] seed=339959
            """.trimIndent()

            val dieList = parseDieList(input)

            var score = 0

            while (score < 10000) {
                score += dieList.sumOf { it.roll() }
            }
            println(dieList[0].rollCounter)
        }

        private fun parseDieList(input: String): List<Die> {
            val regex = Regex("(\\d+): faces=\\[(.*)\\] seed=(\\d+)")
            val dieList = input.lines().map { line ->
                val matchResult = regex.find(line)
                if (matchResult != null) {
                    val (id, facesStr, seedStr) = matchResult.destructured
                    val faces = facesStr.split(",").map { it.trim().toInt() }
                    val seed = seedStr.toInt()
                    Die(id.toInt(), faces, seed)
                } else {
                    throw IllegalArgumentException("Invalid input line: $line")
                }
            }
            return dieList
        }

        fun part2() {
            val (dieInput, trackInput) = """
                1: faces=[1,2,3,4,5,6,7,8,9] seed=339091
                2: faces=[1,2,3,4,5,6,7,8,9] seed=339637
                3: faces=[1,2,3,4,5,6,7,8,9] seed=339389
                4: faces=[1,2,3,4,5,6,7,8,9] seed=340169
                5: faces=[1,2,3,4,5,6,7,8,9] seed=339151
                6: faces=[1,2,3,4,5,6,7,8,9] seed=339187
                7: faces=[1,2,3,4,5,6,7,8,9] seed=339247
                8: faces=[1,2,3,4,5,6,7,8,9] seed=339023
                9: faces=[1,2,3,4,5,6,7,8,9] seed=340049

                
            """.trimIndent().split("\n\n")
            val dieList = parseDieList(dieInput).associateWith { 0 }.toMutableMap()
            val track = trackInput.trim().map { it.toString().toInt() }
            while (dieList.values.any { it < track.size }) {
                dieList.filter { it.value < track.size }.forEach { (die, position) ->
                    val roll = die.roll()
                    if (track[position] == roll) {
                        dieList[die] = position + 1
                    }
                }
            }
            val result = dieList.entries.sortedBy { it.key.rollCounter }.map { it.key.id }.joinToString(",")
            println(result)
        }


