            dieList.forEach { it.roll() }
            var current = track.values.flatMap { t -> dieList.map { t to it }}.filter { it.first.value.toString().toInt() == it.second.currentFace() }.toSet()
            while (current.isNotEmpty()) {
                visited.addAll(current.map { it.first })
                dieList.forEach { it.roll() }
                current = current.flatMap { (node, die) ->
                    val result = node.getNeighborNodes().map { it as Node }.filter { it.value.toString().toInt() == die.currentFace() }.toMutableSet()
                    if (node.value.toString().toInt() == die.currentFace()) {
                        result.add(node)
                    }
                    result.map { it to die }
